__NUXT_JSONP__("/svet/stat/nauru", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s){return {data:[{place:[{tld:".nr",name:"Nauru",area:21,population:10836,slug:j,id_continent:g,information_chatgpt:"\u003Cp\u003ENauru je malý ostrovní stát v Tichomoří. Nachází se v mikronéské oblasti a má rozlohu pouze 21 km². Díky svému bohatství na fosfáty byl Nauru po dlouhou dobu nejbohatším státem na obyvatele na světě. V současné době se však Nauru potýká s řadou problémů, jako jsou ekologické výzvy a sociální a zdravotní problémy.\u003C\u002Fp\u003E\n\u003Cp\u003ENavzdory svým problémům má Nauru několik zajímavých turistických atrakcí. Mezi nejvýznamnější patří návštěva pozůstatků první světové války, jako je třeba pevnost Command Ridge nebo vojenský hřbitov Anibare Bay. Nauru také nabízí skvělé potápěčské možnosti díky svým korálovým útesům a širokému spektru mořských živočichů, jako jsou želvy a delfíni.\u003C\u002Fp\u003E\n\u003Cp\u003EPro turisty jsou také k dispozici tradiční nauruské kulturální akce, jako jsou taneční představení, prohlídky tradičních vesnic a zemědělských oblastí. Nauru je také ideální pro turisty, kteří chtějí zažít méně turistické oblasti, než jsou běžné destinace v Tichomoří.\u003C\u002Fp\u003E\n\u003Cp\u003EPřestože Nauru není běžnou turistickou destinací, návštěva tohoto ostrovního státu může být velmi zajímavou zkušeností pro ty, kteří chtějí prozkoumat méně známé části světa. Turisté by však měli být připraveni na omezené možnosti ubytování, stravování a dopravy v této malé zemi.\u003C\u002Fp\u003E",currency_code:"AUD",currency_name:"australský dolar",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:b},{name:"Hlavní jídlo",value:a,date_update:b},{name:"Chleba",value:a,date_update:b},{name:"Mléko",value:a,date_update:b},{name:"Voda (500ml)",value:a,date_update:b},{name:"Espresso",value:a,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:a,date_update:b},{name:"Pivo",value:a,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Bic Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:a,date_update:b}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"911",date_update:b},{name:"Policie",value:"110",date_update:b},{name:"Hasiči",value:"111",date_update:b},{name:"Zdravotnická záchranná služba",value:"112",date_update:b}],phone_prefix:"+674",coordinates:[{latitude:"-0.522778",longitude:"166.931503"}],people_religion:[{name:"Protestanti",value:"60%",date_update:e},{name:"Římští katolíci",value:"33%",date_update:e},{name:"Jiná náboženství",value:"2%",date_update:e},{name:"Bez vyznání",value:"5%",date_update:e}],people_nationality:[{name:"Nauruánci",value:"58%",date_update:e},{name:"Další etnické skupiny",value:"42%",date_update:e}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup do Nauru je třeba mít platný cestovní pas. Občanský průkaz není dostatečný.",date_update:f},{name:"Cestovní pas",value:"Pro vstup do Nauru je třeba mít platný cestovní pas.",date_update:f},{name:"Vízum",value:"Pro vstup do Nauru je třeba mít platné vízum. Pro občany České republiky není v současnosti (květen 2023) třeba vízum při pobytu do 90 dnů.",date_update:b},{name:"Očkování",value:"Pro vstup do Nauru není povinné očkování. Nicméně, doporučuje se očkování proti žloutence A a B, hepatitidě A a B, tetanu a břišnímu tyfu. Důležité je mít platný zdravotní průkaz a v případě potřeby doložit provedené očkování.",date_update:f},{name:"Cestovní pojištění",value:"Pro vstup do Nauru není vyžadováno cestovní nebo zdravotní pojištění, nicméně se doporučuje mít takové pojištění sjednané před cestou.",date_update:f},{name:"Bezpečnostní situace",value:"Nauru je obecně považováno za bezpečnou zemi pro turisty. Nicméně, jako v jakékoli jiné zemi, mohou se vyskytnout případy drobných krádeží nebo podobných deliktů. Doporučuje se být obezřetný a dbát základních bezpečnostních opatření, např. nechat cennosti v hotelovém sejfu, nechodit po tmě samotný a podobně.",date_update:f},{name:"Další informace",value:"Při cestování do Nauru je třeba být obezřetný a dbát základních pravidel zdravého rozumu. V zemi není příliš rozvinutá turistická infrastruktura, ale místní obyvatelé jsou vstřícní a ochotní pomoci. Doporučuje se dodržovat místní zvyklosti a tradice, a respektovat místní kulturu. Země má tropické podnebí, takže se doporučuje mít s sebou vhodné oblečení a ochranu proti slunci a hmyzu. Dále je dobré mít při sobě dostatek hotovosti, protože v zemi není všude možné platit kartou.",date_update:f}],type_place:k,id_image_cover:h,id_image_hero:h,id_city_main:i,affiliate:[{name:l,value:m}],mpz:"NR",alerts:a,zoom:[{google:n,booking:n}],ids_neighboring_countries:[],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:o,facts:a}],imagePlace:[{id:h,name:j,source:"\u002Fworld\u002Fstates\u002F",date_create:"2023-05-06T09:27:42.033044+00:00",type:k,author:"unsplash.com\u002F@winstonchen"}],placesStatesNeighboring:a,imagesStatesNeighboring:a,placeContinent:[{id:g,slug:"australie-a-oceanie",name:"Austrálie a Oceánie",area:8560000,population:42000000,population_density:4.9,number_states:14,information_chatgpt:"\u003Cp\u003E\u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E je kontinent, které se nachází na jižní polokouli. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E je největší zemí v Oceánii, zatímco Oceánie zahrnuje mnoho ostrovů v Tichomoří, včetně \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENového Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffidzi\"\u003EFidži\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nové Guiney\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsamoa\"\u003ESamoa\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftonga\"\u003ETongy\u003C\u002Fa\u003E\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAustrálie\u003C\u002Fb\u003E je známá svými exotickými zvířaty, jako jsou \u003Cb\u003Eklokani\u003C\u002Fb\u003E, \u003Cb\u003Ekoaly\u003C\u002Fb\u003E a \u003Cb\u003Eemuové\u003C\u002Fb\u003E. Je také domovem mnoha překrásných pláží, kde se lze slunit, surfovat a potápět. Nejznámějšími městy jsou \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsydney\"\u003ESydney\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmelbourne\"\u003EMelbourne\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbrisbane\"\u003EBrisbane\u003C\u002Fa\u003E\u003C\u002Fb\u003E. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsydney\"\u003ESydney\u003C\u002Fa\u003E\u003C\u002Fb\u003E je známé svým \u003Cb\u003Eoperním domem\u003C\u002Fb\u003E a \u003Cb\u003EHarbour Bridge\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmelbourne\"\u003EMelbourne\u003C\u002Fa\u003E\u003C\u002Fb\u003E je považováno za kulturní centrum a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbrisbane\"\u003EBrisbane\u003C\u002Fa\u003E\u003C\u002Fb\u003E je ideální pro milovníky adrenalinových sportů, jako je rafting a skákání padákem.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENový Zéland\u003C\u002Fa\u003E\u003C\u002Fb\u003E, má jedinečnou přírodu a kulturu. Nachází se zde mnoho přírodních památek, včetně hor, jezer a národních parků. Země je také domovem mnoha původních \u003Cb\u003EMaorů\u003C\u002Fb\u003E a jejich kultury. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fauckland\"\u003EAuckland\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fwellington\"\u003EWellington\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou největší města na \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENovém Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, zatímco \u003Cb\u003EQueenstown\u003C\u002Fb\u003E je oblíbená destinace pro turisty hledající adrenalinové sporty a krásnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nová Guinea\u003C\u002Fa\u003E\u003C\u002Fb\u003E je jednou z nejvíce odlehlých a exotických destinací na světě. Země je plná původních kmenů a mnoha z nich si stále zachovávají tradiční zvyky a rituály. Turisté sem jezdí kvůli krásným plážím a překrásné přírodě. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fport-moresby\"\u003EPort Moresby\u003C\u002Fa\u003E\u003C\u002Fb\u003E je hlavním městem země a láká návštěvníky svými muzei a historickými památkami.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EOceánie\u003C\u002Fb\u003E je také známá svými neuvěřitelnými korálovými útesy a podmořským životem. Korálové útesy \u003Cb\u003EVelký bariérový útes\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou největší na světě a lákají milovníky potápění z celého světa. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffidzi\"\u003EFidži\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftonga\"\u003ETonga\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou další oblíbené destinace pro potápěče a snorkelisty.\u003C\u002Fp\u003E\u003Cp\u003EMezi další známé ostrovy v \u003Cb\u003EOceánii\u003C\u002Fb\u003E patří \u003Cb\u003EHavajské ostrovy\u003C\u002Fb\u003E, které jsou součástí USA. \u003Cb\u003EHavajské ostrovy\u003C\u002Fb\u003E jsou známé svými surferskými plážemi, sopkami a krásnou přírodou. \u003Cb\u003ETahiti\u003C\u002Fb\u003E, největší ostrov \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffrancouzska-polynesie\"\u003EFrancouzské Polynésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, láká návštěvníky svými luxusními resorty, bílými plážemi a modrými lagunami. \u003Cb\u003EBora Bora\u003C\u002Fb\u003E, jeden z ostrovů \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffrancouzska-polynesie\"\u003EFrancouzské Polynésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je oblíbený mezi páry hledající romantickou dovolenou.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EOceánie\u003C\u002Fb\u003E má také bohatou historii a kulturu původních obyvatel. Původní obyvatelé \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENového Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003EMaorové\u003C\u002Fb\u003E, mají svou vlastní kulturu a jazyk. V \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou původní obyvatelé \u003Cb\u003EAboridžinci\u003C\u002Fb\u003E, kteří mají svůj vlastní jazyk, tradice a umění. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nová Guinea\u003C\u002Fa\u003E\u003C\u002Fb\u003E má mnoho různých původních kmenů, z nichž každý má své vlastní tradice a jazyk.\u003C\u002Fp\u003E\n\u003Cp\u003ECo se týče cestování do \u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E, musí cestovatelé získat víza pro vstup do země, pokud je to požadováno. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E má mnoho mezinárodních letišť, zatímco v \u003Cb\u003EOceánii\u003C\u002Fb\u003E jsou letiště menší a mohou být omezenější. Mnoho ostrovů v \u003Cb\u003ETichomoří\u003C\u002Fb\u003E má také přísné pravidla pro dovoz zahraničních rostlin a zvířat, aby se chránila původní ekologie.\u003C\u002Fp\u003E\n\u003Cp\u003EV \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E a na mnoha ostrovech v \u003Cb\u003EOceánii\u003C\u002Fb\u003E se můžete potkat s tropickým klimatem s teplými lety a mírnými zimami. V některých částech \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E však může být klima velmi suché a horké, zatímco na jiných místech může být velmi vlhké a deštivé.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E jsou také oblíbenými destinacemi pro adrenalinové sporty, jako je potápění, surfování, skákání padákem, rafting a další. Mnoho turistů také navštěvuje \u003Cb\u003EAustrálii a Oceánii\u003C\u002Fb\u003E kvůli sportovním akcím, jako jsou tenisové turnaje v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nebo ragbyové zápasy na \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENovém Zélandu\u003C\u002Fa\u003E\u003Cb\u003E.\u003C\u002Fp\u003E",coordinates:[{latitude:-25.274398,longitude:133.775136}],type_place:"continent",id_image_cover:g,id_image_hero:g,zoom:[{google:p,booking:p}],information_author:a,seo_tags:a}],placesCities:[{id:1658,id_image_cover:a,importance:c,slug:"aiwo",type_place:d,name:"Aiwo"},{id:1663,id_image_cover:a,importance:c,slug:"anabar",type_place:d,name:"Anabar"},{id:1664,id_image_cover:a,importance:c,slug:"anetan",type_place:d,name:"Anetan"},{id:1660,id_image_cover:a,importance:c,slug:"boe",type_place:d,name:"Boe"},{id:1665,id_image_cover:a,importance:c,slug:"buada",type_place:d,name:"Buada"},{id:1661,id_image_cover:a,importance:c,slug:"denigomodu",type_place:d,name:"Denigomodu"},{id:1667,id_image_cover:a,importance:c,slug:"ijuw",type_place:d,name:"Ijuw"},{id:1666,id_image_cover:a,importance:c,slug:"meneng",type_place:d,name:"Meneng"},{id:1662,id_image_cover:a,importance:c,slug:"uaboe",type_place:d,name:"Uaboe"},{id:i,id_image_cover:a,importance:c,slug:q,type_place:d,name:r}],imagesCities:a,placeCityMain:[{id:i,id_state:o,name:r,population:1190,area:1.52,altitude:s,slug:q,information_chatgpt:a,coordinates:[{latitude:-.547,longitude:166.918}],biggest:"yes",type_place:d,id_image_cover:a,id_image_hero:a,affiliate:[{name:l,value:m}],alerts:a,zoom:[{google:s,booking:11}],parking:a,information_author:a,importance:c,seo_tags:a}],imageCityMain:a}],fetch:{"OrganismsoSidebarListComponent:0":{events:[],images:a}},mutations:[]}}(null,"05-2023","biggest","city","01-2021","09-2021",6,419,1659,"nauru","state","booking",true,13,169,3,"yaren","Yaren",10)));